import React from 'react'
import "../stylesheets/Navbar.css"
import { Link } from 'react-scroll'

class Navbar extends React.Component {

    onClickHandler = (e) => {
        console.log(e.target.name.value)
    }

    render() {
        return(
            <div id="navbar-wrapper">
                <ul id="navbar-ul">
                    <Link to="home"
                          smooth={true}
                          spy={true}
                          duration={500}
                          activeStyle={{background: "#243e75", color: "white"}}>
                        <li className='navbar-li' name="home" onClick={this.onClickHandler}>HOME</li>
                    </Link>
                    <Link to="about"
                          smooth={true}
                          spy={true}
                          duration={500}>
                        <li className='navbar-li' name="about" onClick={this.onClickHandler}>ABOUT</li>
                    </Link>
                    <Link to="portfolio"
                          smooth={true}
                          spy={true}
                          duration={500}>
                        <li className='navbar-li' name="portfolio" onClick={this.onClickHandler}>PORTFOLIO</li>
                    </Link>
                    <Link to="blog"
                          smooth={true}
                          spy={true}
                          duration={500}>
                        <li className='navbar-li' name="blog" onClick={this.onClickHandler}>BLOG</li>
                    </Link>
                    <Link to="contact"
                          smooth={true}
                          spy={true}
                          duration={500}>
                        <li className='navbar-li' name="contact" onClick={this.onClickHandler}>CONTACT</li>
                    </Link>
                </ul>
            </div>
        )
    }
}

export default Navbar
